import React, { Component, useState } from 'react';
import TodoSubList from './todosublist'
import "../App.css"
import Grid from '@material-ui/core/Grid'

const TodoList = (props) => {

    //set up state from app.js

    //Lets return a div with ul with what is inside the state

    let mapper =
        <Grid container
            direction="column"
            justify='center'
            spacing="3"
        >
            {props.map(input =>
                <div>
                    <Grid item
                    >
                        <Grid container spacing={3}>
                            <Grid item md>
                                {input.task}
                            </Grid>
                            <Grid item sm>
                                {input.dateB}
                            </Grid>
                            <Grid item sm>
                                {input.dateE}
                            </Grid>
                            <Grid item sm>
                                {input.completed}
                            </Grid>
                        </Grid>
                        <Grid item>
                            {input.steps.length > 0 && TodoSubList(input.steps)}
                        </Grid>

                    </Grid>

                </div>
            )}
        </Grid>


    let content = (
        <div>
            <ul>
                {mapper}
            </ul>
        </div>
    )
    return content
}


export default TodoList;
